import axios from "axios";

const baseUrl = "http://localhost:5000";

const addBook=async(Book_id,Title,Author,Price,Available)=>{
    try{
        const response = await axios.post(`${baseUrl}/admin/save`,{Book_id,Title,Author,Price,Available})
        .then(({data})=>{
            console.log(data);
        })
        console.log(response.data);

        console.log('Warning Count:', response.data.warningCount);
        console.log('Message:', response.data.message);
      
    }
    catch(error){
         console.log(error);   
    }
}

export {addBook}
